import React, { useState } from "react";
import "./dashmain.css";

export default function Dashboard() {
  const [activeSection, setActiveSection] = useState("Add Products");

  const renderSection = () => {
    switch (activeSection) {
      case "Add Products":
        return <div>Add Products Page</div>;
      case "List Of Products":
        return <div>List of Products Page</div>;
      case "Order History":
        return <div>Order History Page</div>;
      case "Querys":
        return <div>Querys Page</div>;
      default:
        return <div>Welcome to Dashboard</div>;
    }
  };

  return (
    <div className="dashboard-container">
      {/* Sidebar */}
      <div className="sidebar">
        <h2 className="logo">AwaInspires</h2>
        <ul className="menu">
          <li onClick={() => setActiveSection("Add Products")}>Add Products</li>
          <li onClick={() => setActiveSection("List Of Products")}>List Of Products</li>
          <li onClick={() => setActiveSection("Order History")}>Order History</li>
          <li onClick={() => setActiveSection("Querys")}>Querys</li>
        </ul>
      </div>

      {/* Main Content */}
      <div className="main-content">
        {renderSection()}
      </div>
    </div>
  );
}
